import * as React from "react";
import data from "../data.json";
import { useParams } from "react-router-dom";

function Task() {
  // Get ID from URL
  const { id } = useParams();

  //<div>Task {id}</div>
  return (

    <div
      style={{ marginLeft: "5%", marginTop: "5%", backgroundColor: "white" }}
    >
      <p>{data[id - 1].category}</p>
      <h2>{data[id - 1].title}</h2>
      <h2>{data[id - 1].description}</h2>
    </div>
  );
}

export default Task;
